import React from 'react';
import Head from 'next/head';
import Layout from '../components/Layout';

const Home = () => {
    return(
        <body>
        <Layout>
            <Head>
                <title>About</title>
            </Head>    
            <h1>Home</h1>      
        </Layout>
        <style jsx>{`
                body{
                    margin: 0;
                    height: 100vh;
                    background: red;
                }
            
            `}</style>
        </body>
    )
}
export default Home;
